class App extends React.Component {
  render(){
    var titile=[
      {
        id:'1',
        name:'Home',
        status: true
      },
      {
        id:'2',
        name:'Category',
        status:true
      },
      {
        id:'3',
        name:'Contact',
        status:true
      },
      {
        id:'4',
        name:'More',
        status: true
      }
    ]
    return (
      <div>
        <Header/>

        <div className="row">
            <div className="col-xs- col-sm- col-md- col-lg-">
            <Products/>
            </div>
            <div className="col-xs- col-sm- col-md- col-lg-">
            <Products/>
          </div>
        </div>

      </div>

    );

  }

}

export default App;
